import * as constants from "../constants/playerConstants.js";
import * as token from "../tokens/api-token.json";

/* get all teams */
const fetchPlayers = async () => {
  try {
    const results = fetch(`${constants.TRUMEDIA_PROJECT_BASE_URL}/api/nfl/players`, {
        method: 'get', 
        headers: new Headers( {'tempToken': '65a00a2-97cb-46e3-b9fc-481f61612a4c'} )
    });
    return results;
  } catch (err) {
    return `Error: ${err}`;
  }
};


const playerService = {
  fetchPlayers
};

export default playerService;
